package ua

import (
	"github.com/shoothzj/gox/testx"
	"github.com/stretchr/testify/require"
	"testing"
)

func TestDecodeMessageGetEndpointsResp(t *testing.T) {
	buffer := testx.Hex2Buffer(t, "")
	err := buffer.Skip(8)
	require.Nil(t, err)
}

func TestEncodeMessageGetEndpointsResp(t *testing.T) {
	msg := &MessageGetEndpointsResp{}
	_, err := msg.Buffer()
	require.Nil(t, err)
}
